    "CostaRica2018.jpg"
));
year_2018.addEvent(new Event('New Years 2017 -> 2018',
    new Date('December 31, 2017'),
    new Date('January 1, 2018'),
    "https://photos.google.com/share/AF1QipNXGTezg2oznoiLvjlAcXJqqn3EuJOZwZK6xQqR2FXjrwcbi1anotqLJL-DAOiklw?key=SzdFVE9TQmZtdXI1SENfNnU3ck1xTGkxYktFb3V3",
    "NewYears2017-2018.jpg"
));


let year_2019 = new Year(2019);
year_2019.addEvent(new Event("Random 2018",
    new Date('January 1, 2019'),
    new Date('December 31, 2019'),
    "https://photos.google.com/share/AF1QipMxJO6KWs_Pld478D4vgoDJEm9hH09r6ELv1jjrKwC78tPiH5D008GqXZJqyVZh1A?key=bm90bHZaSm5YUC04dm1LTWQ4ZHJoY1pXU0NSbWRB",
    "MarinaWedding.jpeg"
));
year_2019.addEvent(new Event("Marina's Wedding",
    new Date('August 17, 2019'),
    new Date('August 18, 2019'),
    "https://photos.app.goo.gl/G845FRjJFW9xkRhGA",
